$(document).ready(function () {
  $('.login-link > a').click(function () {
    if ($(this).parent().find('.login-form').is(':visible')) {
      $(this).parent().find('.login-form').slideUp(200);
      return false;
    } else {
      $(this).parent().find('.login-form').slideDown(200);
      return false;
    }
  });
  $('.lang-swichers > a').click(function () {
    if ($(this).parent().find('.lang-swicher-menu').is(':visible')) {
      $(this).parent().find('.lang-swicher-menu').slideUp(200);
      return false;
    } else {
      $(this).parent().find('.lang-swicher-menu').slideDown(200);
      return false;
    }
  });

  $('.login-submit').click(function (e) {
    e.preventDefault();
    var form = $(this).parent(),
      login = form.find('input[type="email"]').val(),
      pass = form.find('input[type="password"]').val();

    if (!login.length || !pass.length) {
      form.find("input").addClass('error-inp');
      $('.login-form .error').show(200);
      return false;
    }

    $.ajax({
      type: "POST",
      url: "/aut/check",
      dataType: "json",
      data: {
        login: login,
        pass: pass
      },
      success: function (data) {
        if (typeof(data) != 'object' || data.error) {
          form.find("input").addClass('error-inp');
          $('.login-form .error').show(200);

          return false;
        } else {
          document.location.href = '/';
        }
      }
    });

    return false;
  });

  $('.login-form input').keyup(function () {
    var val = $(this).val();
    if (val.length <= 0) {
      $(this).addClass('error-inp');
    }
    else {
      $('.login-form .error').hide(200);
      $(this).removeClass('error-inp');
    }
  });

  $('.modal .btn-primary').click(function () {
    var error = 0;
    $('.modal .form-horizontal').find('input').each(function () {
      if ($(this).val().length <= 0) {
        $(this).addClass('error-inp');
        error = 1;
      }
      else {
        $(this).removeClass('error-inp');
      }
    });
    if (error == 1) {
      return false;
    } else {
      $.ajax({
        type: "POST",
        url: "/aut/forgot",
        dataType: "json",
        data: {
          email: $('.modal input[type="email"]').val()
        },
        success: function (data) {
          if (typeof(data) != 'object' || data.error) {
            $('.modal input[type="email"]').addClass('error-inp');
          } else {
            $('.modal .form-horizontal').hide();
            $('.modal .modal-ok').show();
            $('.modal .modal-ok .mail-inner').html($('.modal .form-horizontal').find('input').val());
            $('.modal .btn-primary').html($('.modal .btn-primary').data('close-title'));
            $('.modal .btn-primary').unbind('click').attr('data-dismiss', 'modal');
          }
        }
      });

      return false;
    }
    ;
  });

  $('.modal .form-horizontal input').keyup(function () {
    var val = $(this).val();
    if (val.length <= 0) {
      $(this).addClass('error-inp');
    }
    else {
      $('.modal .modal-errorr').hide(200);
      $(this).removeClass('error-inp');
    }
  });

});

